selector_to_html = {"a[href=\"cs.html#front-view-of-the-product\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vis\u00e3o frontal do produto<a class=\"headerlink\" href=\"#front-view-of-the-product\" title=\"Link to this heading\">#</a></h2><h3>1 indicador de Bluetooth claro (LED colado)<a class=\"headerlink\" href=\"#bluetooth-indicator-light-blue-led\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#receiver-keyboard-transmission-speed1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidade de Transmiss\u00e3o do Teclado Receito<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#receiver-keyboard-transmission-speed1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#volume-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es de Volume<a class=\"headerlink\" href=\"#volume-settings\" title=\"Link to this heading\">#</a></h2><p>Digitalize o c\u00f3digo de configura\u00e7\u00e3o correspondente para ativar/desativar o prompt de som do scanner</p>", "a[href=\"wireless.html#high-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Alta velocidade<a class=\"headerlink\" href=\"#high-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html#keyboard-language\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Idioma do teclado<a class=\"headerlink\" href=\"#keyboard-language\" title=\"Link to this heading\">#</a></h2><h3>Obter o idioma atual do teclado<a class=\"headerlink\" href=\"#get-current-keyboard-language\" title=\"Link to this heading\">#</a></h3>", "a[href=\"process.html#prefix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Prefixo<a class=\"headerlink\" href=\"#prefix\" title=\"Link to this heading\">#</a></h2><h3>Adicionar Prefixo<a class=\"headerlink\" href=\"#add-prefix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#get-firmware-version\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Obter vers\u00e3o do Firmware<a class=\"headerlink\" href=\"#get-firmware-version\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"keyboard.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es de teclado<a class=\"headerlink\" href=\"#keyboard-settings\" title=\"Link to this heading\">#</a></h1><h2>Configura\u00e7\u00f5es Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"working.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de trabalho<a class=\"headerlink\" href=\"#working-mode\" title=\"Link to this heading\">#</a></h1><p>Na \u00e1rea de trabalho fora do limite de 2. Receptor G ou sinal Bluetooth, voc\u00ea pode ativar o modo de armazenamento do scanner, seguindo as etapas descritas abaixo. Neste modo, todos os dados digitalizados ser\u00e3o armazenados diretamente no scanner. Antes de enviar os dados, ser\u00e1 guardado permanentemente no scanner para que voc\u00ea possa carregar os dados quando o scanner estiver no intervalo de sinal de recebimento.</p>", "a[href=\"scanmode.html#continuous-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo cont\u00ednuo<a class=\"headerlink\" href=\"#continuous-mode\" title=\"Link to this heading\">#</a></h2><p>O scanner funciona continuamente. Se a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico, a verifica\u00e7\u00e3o atual termina. Se o tempo exceder o tempo especificado, a pr\u00f3xima verifica\u00e7\u00e3o \u00e9 ativada automaticamente.</p>", "a[href=\"faq.html#question-5-scan-successful-uploaded-data-incorrect\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pergunta 5:Scan com sucesso, dados enviados incorretos?<a class=\"headerlink\" href=\"#question-5-scan-successful-uploaded-data-incorrect\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong></p>", "a[href=\"faq.html#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pergunta 3: O scanner escanea com sucesso, antecipa tr\u00eas vezes e n\u00e3o carrega dados. Como posso resolver este problema?<a class=\"headerlink\" href=\"#question-3-the-scanner-scans-successfully-beeps-three-times-and-fails-to-upload-data-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong></p>", "a[href=\"wired.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Cabo<a class=\"headerlink\" href=\"#wired-mode\" title=\"Link to this heading\">#</a></h1><h2>Modo de transmiss\u00e3o<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cabo USB como teclado<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"intro.html#working-via-usb-cable\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trabalhando por cabo USB<a class=\"headerlink\" href=\"#working-via-usb-cable\" title=\"Link to this heading\">#</a></h2><p>Conecte o scanner com seu dispositivo por cabo USB. Se voc\u00ea usar o teclado dos EUA, ele ser\u00e1 plugado e reproduzido. Se voc\u00ea usa outro tipo de teclado, por favor, consulte \u00ab<a class=\"reference internal\" href=\"keyboard.html#keyboard-language\"><span class=\"std std-ref\">idioma do teclado</span></a>\u00bb para configurar o idioma do teclado antes de utiliz\u00e1-lo.</p>", "a[href=\"barcode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"system.html#sleep-time\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Hora de dormir<a class=\"headerlink\" href=\"#sleep-time\" title=\"Link to this heading\">#</a></h2><p>Ao escanear o seguinte c\u00f3digo de configura\u00e7\u00e3o, voc\u00ea pode definir o scanner para entrar em modo de suspens\u00e3o ap\u00f3s um determinado per\u00edodo de tempo quando nenhum c\u00f3digo \u00e9 escaneado, para reduzir o consumo de energia.</p>", "a[href=\"scanmode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Escaneo<a class=\"headerlink\" href=\"#scan-mode\" title=\"Link to this heading\">#</a></h1><h2>Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"scanmode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"cs.html#rear-view-of-the-product\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Vis\u00e3o traseira do produto<a class=\"headerlink\" href=\"#rear-view-of-the-product\" title=\"Link to this heading\">#</a></h2><h3>1 Janela de Escaneamento<a class=\"headerlink\" href=\"#scanning-window\" title=\"Link to this heading\">#</a></h3>", "a[href=\"intro.html#working-via-usb-dongle-wireless-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trabalhando via USB Dongle (modo sem fio)<a class=\"headerlink\" href=\"#working-via-usb-dongle-wireless-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#usb-keyboard-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidade do teclado USB<a class=\"headerlink\" href=\"#usb-keyboard-speed\" title=\"Link to this heading\">#</a></h2><h3>Obter Velocidade do Teclado<a class=\"headerlink\" href=\"#get-keyboard-speed\" title=\"Link to this heading\">#</a></h3>", "a[href=\"intro.html#working-via-bluetooth\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Trabalhando via Bluetooth<a class=\"headerlink\" href=\"#working-via-bluetooth\" title=\"Link to this heading\">#</a></h2>", "a[href=\"bluetooth.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo Bluetooth<a class=\"headerlink\" href=\"#bluetooth-mode\" title=\"Link to this heading\">#</a></h1>", "a[href=\"faq.html#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pergunta 1: A verifica\u00e7\u00e3o foi bem-sucedida, os sons da campainha uma vez, mas nenhum dado foi carregado?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong> O scanner entrou no modo de armazenamento e precisa escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"wireless.html#low-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Baixa velocidade<a class=\"headerlink\" href=\"#low-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#normal-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo normal<a class=\"headerlink\" href=\"#normal-mode\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#usb-hid-multi-key-send-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Conjunto de envio de chave m\u00faltipla HID USB<a class=\"headerlink\" href=\"#usb-hid-multi-key-send-set\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#hide-set\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Esconder Conjunto<a class=\"headerlink\" href=\"#hide-set\" title=\"Link to this heading\">#</a></h2><h3>Esconder c\u00f3digos de barras iniciando<a class=\"headerlink\" href=\"#hide-barcode-start-chars\" title=\"Link to this heading\">#</a></h3>", "a[href=\"barcode.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologias<a class=\"headerlink\" href=\"#symbologies\" title=\"Link to this heading\">#</a></h1><h2>Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Edi\u00e7\u00e3o de dados<a class=\"headerlink\" href=\"#data-editing\" title=\"Link to this heading\">#</a></h1><h2>Formato de sa\u00edda<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para alterar o formato de transmiss\u00e3o de dados, digitalize um dos oito c\u00f3digos de barras correspondentes ao formato desejado.</p>", "a[href=\"system.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es do Sistema<a class=\"headerlink\" href=\"#system-settings\" title=\"Link to this heading\">#</a></h1><h2>Restaurar configura\u00e7\u00f5es padr\u00e3o<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando um erro desconhecido ocorre no scanner, voc\u00ea pode redefinir o scanner restaurando as configura\u00e7\u00f5es padr\u00e3o.</p>", "a[href=\"wireless.html#medium-speed\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Velocidade M\u00e9dia<a class=\"headerlink\" href=\"#medium-speed\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wired.html#automatic-selection-of-wired-wireless-transmission\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Sele\u00e7\u00e3o autom\u00e1tica de transmiss\u00e3o sem fio<a class=\"headerlink\" href=\"#automatic-selection-of-wired-wireless-transmission\" title=\"Link to this heading\">#</a></h2>", "a[href=\"barcode.html#start-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pergunta 2:O scanner escanea com sucesso, prefere duas vezes e pode enviar dados normalmente. O que est\u00e1 acontecendo?<a class=\"headerlink\" href=\"#question-2-the-scanner-scans-successfully-beeps-twice-and-can-upload-data-normally-what-is-going-on\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong> A bateria do canh\u00e3o do scanner est\u00e1 baixa e pede que seja recarregada.</p>", "a[href=\"character.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"#rd-2023-wireless-scanner-quick-setup-guide\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Guia de configura\u00e7\u00e3o r\u00e1pida do scanner sem fios <strong>RD-2023</strong><a class=\"headerlink\" href=\"#rd-2023-wireless-scanner-quick-setup-guide\" title=\"Link to this heading\">#</a></h1>", "a[href=\"process.html#suffix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Suffix<a class=\"headerlink\" href=\"#suffix\" title=\"Link to this heading\">#</a></h2><h3>Adicionar Sufixo<a class=\"headerlink\" href=\"#add-suffix\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#auto-sensing-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de Detec\u00e7\u00e3o Autom\u00e1tica<a class=\"headerlink\" href=\"#auto-sensing-mode\" title=\"Link to this heading\">#</a></h2><p>No modo de detec\u00e7\u00e3o autom\u00e1tica, o scanner detectar\u00e1 o brilho do ambiente ao redor. Quando o brilho muda, a varredura \u00e9 ativada. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de verifica\u00e7\u00e3o exceder o tempo de trabalho \u00fanico. Independentemente de a \u00faltima verifica\u00e7\u00e3o ter sido bem-sucedida ou falhada, o brilho do ambiente ao redor ser\u00e1 detectado novamente.</p>", "a[href=\"process.html#quick-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00e3o R\u00e1pida<a class=\"headerlink\" href=\"#quick-setup\" title=\"Link to this heading\">#</a></h2><h3>Adicionar Prefixo<a class=\"headerlink\" href=\"#id3\" title=\"Link to this heading\">#</a></h3>", "a[href=\"faq.html#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pergunta 4:O scanner bebe cinco vezes quando um bot\u00e3o \u00e9 pressionado. Como posso resolver esse problema?<a class=\"headerlink\" href=\"#question-4-the-scanner-beeps-five-times-when-a-button-is-pressed-how-can-i-solve-this-problem\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong> A bateria est\u00e1 baixa e precisa ser carregada antes de poder ser usada novamente.</p>", "a[href=\"keyboard.html#case-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Configura\u00e7\u00f5es Caso<a class=\"headerlink\" href=\"#case-settings\" title=\"Link to this heading\">#</a></h2><h3>normal<a class=\"headerlink\" href=\"#normal\" title=\"Link to this heading\">#</a></h3>", "a[href=\"scanmode.html#end-setup\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#end-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"wireless.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Modo sem fio<a class=\"headerlink\" href=\"#wireless-mode\" title=\"Link to this heading\">#</a></h1><p>Este modo usa o 2. Banda de frequ\u00eancia GHz para transmiss\u00e3o de dados e depende da tecnologia de frequ\u00eancia de r\u00e1dio (FR), que conecta ao computador atrav\u00e9s de um receptor USB e permite que o scanner mova-se livremente a uma certa dist\u00e2ncia.</p>", "a[href=\"cs.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Introdu\u00e7\u00e3o do Produto<a class=\"headerlink\" href=\"#product-introduction\" title=\"Link to this heading\">#</a></h1><h2>Vis\u00e3o frontal do produto<a class=\"headerlink\" href=\"#front-view-of-the-product\" title=\"Link to this heading\">#</a></h2><h3>1 indicador de Bluetooth claro (LED colado)<a class=\"headerlink\" href=\"#bluetooth-indicator-light-blue-led\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#restore-default-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Restaurar configura\u00e7\u00f5es padr\u00e3o<a class=\"headerlink\" href=\"#restore-default-settings\" title=\"Link to this heading\">#</a></h2><p>Quando um erro desconhecido ocorre no scanner, voc\u00ea pode redefinir o scanner restaurando as configura\u00e7\u00f5es padr\u00e3o.</p>", "a[href=\"barcode.html#id1\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologias 2D<a class=\"headerlink\" href=\"#id1\" title=\"Link to this heading\">#</a></h2>", "a[href=\"working.html#storage-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de armazenamento<a class=\"headerlink\" href=\"#storage-mode\" title=\"Link to this heading\">#</a></h2><h3>Envio de dados<a class=\"footnote-reference brackets\" href=\"#id2\" id=\"id1\" role=\"doc-noteref\"><span class=\"fn-bracket\">[</span>1<span class=\"fn-bracket\">]</span></a><a class=\"headerlink\" href=\"#data-upload1\" title=\"Link to this heading\">#</a></h3>", "a[href=\"wireless.html#one-to-one-pairing\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Pareamento Um-para-\u00fanico<a class=\"headerlink\" href=\"#one-to-one-pairing\" title=\"Link to this heading\">#</a></h2>", "a[href=\"faq.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Perguntas Frequentes<a class=\"headerlink\" href=\"#faq\" title=\"Link to this heading\">#</a></h1><h2>Pergunta 1: A verifica\u00e7\u00e3o foi bem-sucedida, os sons da campainha uma vez, mas nenhum dado foi carregado?<a class=\"headerlink\" href=\"#question-1-the-scan-is-successful-the-buzzer-sounds-once-but-no-data-is-uploaded\" title=\"Link to this heading\">#</a></h2><p><strong>Resposta:</strong> O scanner entrou no modo de armazenamento e precisa escanear <a class=\"reference internal\" href=\"working.html#normal-mode\"><span class=\"std std-ref\">Modo Normal</span></a> para recuperar.</p>", "a[href=\"character.html#end-character-settings\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Finalizar Configura\u00e7\u00f5es do Personagem<a class=\"headerlink\" href=\"#end-character-settings\" title=\"Link to this heading\">#</a></h2><p>O caractere final \u00e9 adicionado ap\u00f3s os dados decodificados no formato de dados decodificados + caractere final.</p>", "a[href=\"barcode.html#d-symbologies\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Simbologias 1D<a class=\"headerlink\" href=\"#d-symbologies\" title=\"Link to this heading\">#</a></h2>", "a[href=\"intro.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Caminho da Conex\u00e3o<a class=\"headerlink\" href=\"#connection-way\" title=\"Link to this heading\">#</a></h1><p>O Leitor QR pode ser conectado ao seu dispositivo via bluetooth, USB e USB, voc\u00ea pode escolher uma das formas de conex\u00e3o para conectar o scanner com seu dispositivo.</p>", "a[href=\"process.html#output-format\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Formato de sa\u00edda<a class=\"headerlink\" href=\"#output-format\" title=\"Link to this heading\">#</a></h2><p>Para alterar o formato de transmiss\u00e3o de dados, digitalize um dos oito c\u00f3digos de barras correspondentes ao formato desejado.</p>", "a[href=\"scanmode.html#key-trigger-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de disparo de chaves<a class=\"headerlink\" href=\"#key-trigger-mode\" title=\"Link to this heading\">#</a></h2><p>Pressione o bot\u00e3o para acionar a varredura e solte o bot\u00e3o para terminar a verifica\u00e7\u00e3o. A verifica\u00e7\u00e3o termina quando a verifica\u00e7\u00e3o for bem-sucedida ou o tempo de leitura exceder o tempo de leitura \u00fanico.</p>", "a[href=\"wired.html#transmission-mode\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Modo de transmiss\u00e3o<a class=\"headerlink\" href=\"#transmission-mode\" title=\"Link to this heading\">#</a></h2><h3>Cabo USB como teclado<a class=\"headerlink\" href=\"#usb-cable-as-keyboard\" title=\"Link to this heading\">#</a></h3>", "a[href=\"system.html#battery-information\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Informa\u00e7\u00f5es da bateria<a class=\"headerlink\" href=\"#battery-information\" title=\"Link to this heading\">#</a></h2>", "a[href=\"character.html\"]": "<h1 class=\"tippy-header\" style=\"margin-top: 0;\">Exterminador<a class=\"headerlink\" href=\"#terminator\" title=\"Link to this heading\">#</a></h1><h2>Iniciar Configura\u00e7\u00e3o<a class=\"headerlink\" href=\"#start-setup\" title=\"Link to this heading\">#</a></h2>", "a[href=\"process.html#appendix\"]": "<h2 class=\"tippy-header\" style=\"margin-top: 0;\">Ap\u00eandice<a class=\"headerlink\" href=\"#appendix\" title=\"Link to this heading\">#</a></h2><h3>C\u00f3digos de barras num\u00e9ricas<a class=\"headerlink\" href=\"#numeric-bar-codes\" title=\"Link to this heading\">#</a></h3>"}
skip_classes = ["headerlink", "sd-stretched-link", "sd-rounded-pill"]

window.onload = function () {
    for (const [select, tip_html] of Object.entries(selector_to_html)) {
        const links = document.querySelectorAll(`article.bd-article ${select}`);
        for (const link of links) {
            if (skip_classes.some(c => link.classList.contains(c))) {
                continue;
            }

            tippy(link, {
                content: tip_html,
                allowHTML: true,
                arrow: true,
                placement: 'auto-start', maxWidth: 500, interactive: false,

            });
        };
    };
    console.log("tippy tips loaded!");
};
